load("@rules_cc_autoconf//autoconf:defs.bzl", "autoconf") autoconf(name, data, out, checks, package_info_file, package_name, package_version, template) Generate configuration headers using autoconf-like checks. This rule mimics autoconf functionality by running compilation checks against the configured cc_toolchain and generating a config.h file with the results. Example: autoconf( name = "config", out = "config.h", checks = [ macros.AC_CHECK_HEADER("stdio.h"), macros.AC_CHECK_HEADER("stdlib.h"), macros.AC_CHECK_FUNC("printf"), ], package_name = "myproject", package_version = "1.0.0",
) With file-based checks: autoconf( name = "config", out = "config.h", checks = [ macros.AC_TRY_COMPILE( define = "CUSTOM_CHECK", file = ":custom_test.c", ), ], data = [":custom_test.c"],
) ATTRIBUTES Name Description Type Mandatory Default name A unique name for this target. Name required data Files referenced by checks (via the file parameter). List of labels optional [] out The output config file (typically config.h). Label; nonconfigurable required checks List of JSON-encoded checks from macros (e.g., macros.AC_CHECK_HEADER('stdio.h')). List of strings optional [] package_info_file A json file containing a map {"name": "{PACKAGE_NAME}", "version": "{PACKAGE_VERSION"}. Note that each field is optional. This attribute is mutually exclusive with package_name and package_version. Label optional None package_name Package name for PACKAGE_NAME define. This attribute is mutually exclusive with package_info_file. String optional "" package_version Package version for PACKAGE_VERSION define. This attribute is mutually exclusive with package_info_file. String optional "" template Optional template file (config.h.in) to use as base. Label optional None
